import React from "react";
import "./left-panel.css";

const LeftPanel = () => {
  const btns = [
    ["7", "8", "9"],
    ["4", "5", "6"],
    ["1", "2", "3"],
    ["0", ".", "AC"],
  ];
  return (
    <div className="leftPanel">
      {btns.map((bt, i) => (
        <div key={i} className="numbers">
          <div>7</div>
          <div>8</div>
          <div>9</div>
        </div>
      ))}
      <div className="numbers">
        <div>7</div>
        <div>8</div>
        <div>9</div>
      </div>
      <div className="numbers">
        <div>4</div>
        <div>5</div>
        <div>6</div>
      </div>
      <div className="numbers">
        <div>1</div>
        <div>2</div>
        <div>3</div>
      </div>
      <div className="numbers">
        <div>0</div>
        <div>.</div>
        <div>AC</div>
      </div>
    </div>
  );
};

export default LeftPanel;
